syntax = "proto3";
option java_package = "emu.grasscutter.net.proto";
import "AvatarExpeditionStartInfo.proto";
import "AvatarExpeditionInfo.proto";


message AvatarExpeditionStartRsp {
	int32 retcode = 4;
	repeated AvatarExpeditionStartInfo expedition_start_info = 5;
	map<uint64, AvatarExpeditionInfo> expedition_info_map = 14;
}